import json
import logging
import base64
import os
from utils.processing import extract_file_extension, api_response
from utils.s3 import s3_upload, generate_presigned_url
from botocore.exceptions import ClientError

bucket = os.environ['BUCKET_NAME']

base_path = "images/generated/"

logger = logging.getLogger()
logger.setLevel(logging.INFO)


# main lambda handler method
def handler(event, context):
    try:
        logger.info('Uploading image to s3')
        payload = json.loads(event['body'])
        logger.info(f'Payload: {payload}')
        image, uuid = payload['image'], payload['uuid']
        file_extension = extract_file_extension(image)
        file_name = f"{base_path}{uuid}.{file_extension}"
        image = image[image.find(",") + 1:]
        file_content = base64.b64decode(image)
        logger.info(f'saving_s3_file , bucket={bucket}')
        upload_response = s3_upload(file_name, file_content)
        logger.info('S3 Result' + json.dumps(upload_response, indent=2))
        return api_response(200, json.dumps(upload_response))
    except ClientError as e:
        logger.error(e)
        return api_response(500, e)


